import React from 'react';

import './Header.css';

const Header = () => {
    return (
        <header>
            <div className="container">
                <div className="col-3">
                    <div className="logo">
                        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcScb1ooRufYzO-X4mBwctTf_yNt7RSQBS0EU6bVRQ-DRj5f2B93&s" alt=""/>
                    </div>
                </div>
            </div>
        </header>
    );
};

export default Header;
